M07 %[output:14a79ae6]
%%
addpath('./modernRobot')
addpath('./modernRobot/mr/')
addpath('./kepler_new')

W = [0.10915 0.08230];
L = [0.425 0.39225]; 
H = [0.089159 0.09465];

% W = sym("W",[1,2],"real");
% L = sym("L",[1,2],"real");
% H = sym("H",[1,2],"real");

n = 6;
theta = [0 0 0 0 0 0]';
% theta = [30 20 10 25 45 60]'./180*pi;
% M将决定所有螺旋变换的基础位置
M0b = [-1 0 0 0; %[output:group:49b696f5] %[output:55ac9ba4]
     0 0 1 0; %[output:55ac9ba4]
     0 1 0 0; %[output:55ac9ba4]
     L(1)+L(2) W(1)+W(2) H(1)-H(2) 1 %[output:55ac9ba4]
     ]' %[output:group:49b696f5] %[output:55ac9ba4]
%% vs6 有两种求解方式：
% 一种直接用定义求(-omg x p06) ，一种用虚拟刚体在原点的速度求。
% 第一种更容易程式化, 而且 坐标系的原点位置可以在整个转轴上随便选择 为了后面的动力学，可以尽量选择和URDF匹配的坐标系
% vs6 = cross([0 1 0]',[-(L(1)+L(2)), 0 ,H(2)-H(1)]')
% 为什么可以在轴线上任选坐标系原点位置？数学上很好看出来，叉乘消去一个维度。物理意义在于，一旦确定好M矩阵，那么末端坐标系都确定了，所有的旋转都是按照轴线去改变M矩阵代表的坐标系的位置，和前序的坐标系位置在轴线的哪里无关
% 无论旋量轴上的坐标系选择在什么地方，最终都可以通过一次旋转，将末端坐标系（M）转移到想要的位置（这就是PoE建模的坐标系无关特性）
% 注意注意  这种无关性只适用于旋转轴关节机械臂？no 移动关节也适用
%% 这种无关性不是"bug"，而是螺旋理论的一个"feature"——它反映了刚体运动的本质特性，即刚体运动由旋转轴和螺距（纯转动关节h=0）完全确定，与具体的参考点选择无关。

%% 搞清楚螺旋轴的正方向（和实际电机转动方向一致）
% 对于旋转关节机械臂上的旋量而言，节距h=0。如果存在节距，则不符合实际物理意义(如果h不等于0，则会发生坐标系的螺旋进动，实际中不能有）

%% 反向倒推法
omgs6 = [0 1 0]';
p06 = [(L(1)+L(2)), W(1)+W(2) ,H(1)-H(2)]' %[output:3c99b291]
vs6 = cross(omgs6, -p06); % 可以发现W维度的信息因为叉乘而被消去了
S(:,6) = [omgs6; vs6];

omgs5 = [0 0 -1]';
p05 = [L(1)+L(2) W(1) 0]';
vs5 = cross(omgs5,-p05);
S(:,5) = [omgs5; vs5];

omgs4 = [0 1 0]';
p04 = [L(1)+L(2) 0 H(1)]';
vs4 = cross(omgs4, -p04);
S(:,4) = [omgs4; vs4];

omgs3 = [0 1 0]';
p03 = [L(1) 0 H(1)]';
vs3 = cross(omgs3, -p03);
S(:,3) = [omgs3; vs3];

omgs2 = [0 1 0]';
p02 = [0 0 H(1)]';
vs2 = cross(omgs2, -p02);
S(:,2) = [omgs2; vs2];

omgs1 = [0 0 1]';
p01 = [0 0 0]';
vs1 = cross(omgs1, -p01);
S(:,1) = [omgs1; vs1];

T0b = M0b;   % 申请内存

% 从后向前或从前向后乘此时是数学上的等效。但要看到实际的物理意义可以从后向前乘
for i = n:-1:1
    T0b = MatrixExp6(VecTose3(S(:,i))*theta(i))*T0b;
end
T0b %[output:84d2b844]

FKinSpace(M0b,S,theta) %[output:25d5b972]

% T06 T05 T04 都要一个个求
% T06
M06 = M0b*inv(M67);
T06 = M06;   % 申请内存

for i = n-1:-1:1
    T06 = MatrixExp6(VecTose3(S(:,i))*theta(i))*T06;
end
T06 %[output:57b985c7]

