q = theta' + th0;
% q = [30 20 10 25 45 60]./180*pi + th0;
% q = [34.5651   24.9974  125.3279   16.8876   15   95.4620] * pi / 180 * 1;
td06 = urRobot.fkine(q) %[output:1bb33b74]
tmSDH1 = urRobot.A(1,q) %[output:3b748969]

urRobot.display(); %[output:47efe568]
view(3); %[output:6a3b4457]
urRobot.teach(q); %[output:6a3b4457]
